    function getPathCoords(path) {
        //Organize a polyline string with alternating x and y values into [x, y] coordinate pairs:
        const coords = [];
        for (let i = 0; i < path.length; i += 2) {
            const x = path[i],
                y = path[i + 1];
            coords.push([x, y]);
        }
        return coords;
    }

    const pathMap = {};
    Object.entries(countries).concat(Object.entries(waterfront))
        .forEach(([code, paths]) => {
            paths.forEach(path => {
                getPathCoords(path).forEach(coord => {
                    if (!pathMap[coord]) { pathMap[coord] = []; }
                    pathMap[coord].push(path);
                });
            });
        });
    //console.log('pathMap', pathMap);

    const borderList = [],
        borderMap = {};
    function splitBorders(path) {
        const coords = getPathCoords(path),
            borders = [];

        function registerBorder(coords) {
            //console.log('rb', coords);
            if (!borderMap[coords]) {
                const i = borderList.length;
                borderList.push({
                    coords: coords,
                    simply: null,
                });

                borderMap[coords] = {
                    ix: i,
                };
                borderMap[coords.slice().reverse()] = {
                    ix: i,
                    reversed: true,
                };
            }
            borders.push(borderMap[coords]);
        }

        let currBorder = [],
            startI = null;
        for (let i = 0; i <= 2 * coords.length; i++) {
            const coord = coords[i % coords.length];
            const bordering = pathMap[coord];

            //Loop until we find a "corner" between several countries/waters, which is a suiting starting point:
            if (startI === null) {
                if ((bordering.length > 2) || (i === coords.length)) {
                    startI = i;
                }
            }
            if (startI !== null) {
                if (i > (startI + coords.length)) { break; }

                //console.log(i, coord, bordering);
                currBorder.push(coord);
                if ((bordering.length > 2) && (i !== startI)) {
                    registerBorder(currBorder);
                    currBorder = [coord];
                }
            }
        }
        //Islands:
        if (currBorder.length > 1) {
            registerBorder(currBorder);
        }
        return borders;
    }

    const borderedCountries = Object.entries(countries).map(([code, paths]) => ({
        code,
        paths: paths.map(p => ({ borders: splitBorders(p) })),
    }));
    //console.log(borderedCountries[0]);

    new Vue({
        el: '#app',
        data: {
            tolerance: 0,
        },
        computed: {
            simpleCountries() {
                borderList.forEach(b => {
                    b.simply = simplify(
                        b.coords.map(([x, y]) => ({ x, y })),
                        this.tolerance,
                        true
                    ).map(c => [c.x, c.y]);
                });

                let pointCount = 0;
                function findSimpleBorder(b) {
                    let coords = borderList[b.ix].simply;
                    if (b.reversed) {
                        coords = coords.slice().reverse();
                    }
                    pointCount += coords.length;
                    return coords;
                }
                const simpler = borderedCountries.map(c1 => {
                    const c2 = {
                        code: c1.code,
                        paths: [],
                    };
                    c2.paths = c1.paths.map(p => {
                        let borderCoords = p.borders.map(findSimpleBorder);
                        return borderCoords;
                    });
                    return c2;
                });

                //console.log(`Tolerance ${this.tolerance}: ${pointCount} points`);
                return simpler;
            },
            borders() {
                return borderList.map(b => b.coords);
            },
        },
        mounted() {
            const svg = document.querySelector('#map');
            zoomableSvg(svg);

            //Log map coordinates on click:
            //https://stackoverflow.com/questions/29261304/how-to-get-the-click-coordinates-relative-to-svg-element-holding-the-onclick-lis */
            var pt = svg.createSVGPoint();  // Created once for document
            svg.addEventListener('click', function alert_coords(evt) {
                pt.x = evt.clientX;
                pt.y = evt.clientY;
                // The cursor point, translated into svg coordinates
                var cursorpt = pt.matrixTransform(svg.getScreenCTM().inverse());
                //console.log([cursorpt.x, cursorpt.y].map(c => c.toFixed(1)));
            });
        },
    });
