const paths = document.getElementsByTagName('path');
const infoBox = document.getElementById("infoBox");
const svg = document.querySelector('#map');

for (var path of paths) {
    path.classList.add("passive")
    path.addEventListener('mouseover', function (e) {
        Active(e);
    });
    path.addEventListener('mouseout', function (e) {
        Passive(e);
    });
}

function Active(e) {
    e.target.classList.remove("passive")
    e.target.classList.add("active")

    mapSearch(e.target.id);

    infoBox.style.display = "block";

    updateInfoPosition(e);

    document.addEventListener("mousemove", (e) => {
        updateInfoPosition(e);
    });
}
function Passive(e) {
    e.target.classList.remove("active")
    e.target.classList.add("passive")

    infoBox.style.display = "none";

    document.removeEventListener("mousemove", (e) => {
        updateInfoPosition(e);
    });
}

function updateInfoPosition(e) {

    const offsetX = 10; // 位移X軸的距離
    const offsetY = 10; // 位移Y軸的距離

    infoBox.style.left = e.pageX + offsetX + "px";
    infoBox.style.top = e.pageY + offsetY + "px";
}